import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Footer from "./components/Footer/Footer";
import Header from "./components/Header/Header";
import PrivateRoute from "./components/PrivateRoute/PrivateRoute";
import About from "./pages/About/About";
import Contact from "./pages/Contact/Contact";
import AddTour from "./pages/Dashboard/AddTour";
import Dashboard from "./pages/Dashboard/Dashboard";
import ManageBooking from "./pages/Dashboard/ManageBooking";
import MyBooking from "./pages/Dashboard/MyBooking";
import TourList from "./pages/Dashboard/TourList";
import UpdateTour from "./pages/Dashboard/UpdateTour";
import Home from "./pages/Home/Home";
import Login from "./pages/Login/Login";
import NotFound from "./pages/NotFound/NotFound";
import Register from "./pages/Register/Register";
import SingleTour from "./pages/SingleTour/SingleTour";
import Tours from "./pages/Tours/Tours";

function App() {
  return (
    <div>
      <AuthProvider>
        <Router>
          <Header />
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/about">
              <About />
            </Route>
            <Route path="/tours">
              <Tours />
            </Route>
            <PrivateRoute path="/tour-details/:id">
              <SingleTour />
            </PrivateRoute>
            <Route path="/contact">
              <Contact />
            </Route>
            <Route path="/login">
              <Login />
            </Route>
            <Route path="/register">
              <Register />
            </Route>
            <PrivateRoute path="/dashboard">
              <Dashboard />
            </PrivateRoute>
            <PrivateRoute path="/add-tour">
              <AddTour />
            </PrivateRoute>
            <PrivateRoute path="/tour-list">
              <TourList />
            </PrivateRoute>
            <PrivateRoute path="/my-booking/:id">
              <MyBooking />
            </PrivateRoute>
            <PrivateRoute path="/booking-list">
              <ManageBooking />
            </PrivateRoute>
            <PrivateRoute path="/update-tour/:id">
              <UpdateTour />
            </PrivateRoute>
            <Route path="*">
              <NotFound />
            </Route>
          </Switch>
          <Footer />
        </Router>
      </AuthProvider>
    </div>
  );
}

export default App;
